function removeDuplicates(data) {
  const uniqueIds = [];

  const unique = data.filter(element => {
    const isDuplicate = uniqueIds.includes(element.division);

    if (!isDuplicate) {
      uniqueIds.push(element.division);

      return true;
    }

    return false;
  });

  // 👇️ [{id: 1, name: 'Tom'}, {id: 2, name: 'Nick'}]
  return unique
}

